class VehicleMakeModuleStore {
	constructor(rootStore){
		this.rootStore = rootStore
		this.vehicleMakeListViewStore = new VehicleMakeListViewStore(this)
	}

	@observable makes = [
		{ id: "0", VehicleMake: "Ford Taurus", logo: "https://seeklogo.net/wp-content/uploads/2014/07/ford-logo.png" },
		{ id: "1", VehicleMake: "Toyota", logo: "https://seeklogo.net/wp-content/uploads/2014/06/toyota-logo-vector-download.jpg" },
		{ id: "2", VehicleMake: "Volkswagen Golf", logo: "data:image/png;base64,"},
		{ id: "3", VehicleMake: "BMW", logo:"https://images-na.ssl-images-amazon.com/images/I/61b2FkbZsEL._AC_SY355_.jpg" },
		{ id: "4", VehicleMake: "Honda", logo: "https://seeklogo.net/wp-content/uploads/2011/05/honda-silver-logo-vector.png"},
		{ id: "5", VehicleMake: "Alfa", logo: "data:image/png;base64,"}, 
		{ id: "7", VehicleMake: "Hyundai Kona", logo: "https://di-uploads-pod4.dealerinspire.com/rivercityhyundai/uploads/2017/05/HyundaiLogoStacked_4cblk-1024x659.gif" }
	]

	//delete a car by id 
	@action removeCar = (id) => {
		//had to replace the splice method so that the cars array isn't mutated after deleting 
		this.makes[id] = null
  	}

}

class VehicleMakeListViewStore {
	constructor(vehicleMakeModuleStore){
		this.vehicleMakeModuleStore = vehicleMakeModuleStore
	}

	@observable filter = ""
	@observable isSorted = false;

    // save id of last car so that the user doesn't have to manually insert it
	//@observable lastId = this.rootStore.cars.slice(-1)[0].id

	//list only car makes
	@computed get listMakes(){
		const matchesFilter = new RegExp(this.filter, "i")
		return this.vehicleMakeModuleStore.makes.filter(car => car !== null).filter(car => !this.filter || matchesFilter.test(car.VehicleMake))
	}

	//list alphabetically sorted makes
	@computed get sortedMakes() {
    	return this.listMakes.filter(car => car !== null).slice().sort((a, b) => (a.VehicleMake > b.VehicleMake) ? 1 : -1);
  	}

}

